```python
import random
import numpy as np

# Define functions to generate each feature based on the rules provided
def target_thickness():
    return np.random.uniform(low=0.273, high=1.0, loc=0.593)

def pulse_width():
    return np.random.uniform(loc=30, scale=np.sqrt(1030000))

def energy():
    return target_thickness() * 2.35 + np.random.normal(loc=13.9, scale=np.sqrt(2350), loc=-7.6)

def spot_size():
    return np.random.uniform(low=2.13, high=60, loc=3.3)

def intensity():
    return (np.random.normal(loc=5.1e20, scale=np.sqrt(3.96e41), loc=6.22e20) * np.exp(energy() / 1.12))

def power():
    return intensity() * spot_size()

def cutoff_energy():
    return energy() + 5.3

# Generate 25 new data points
data = []
for i in range(25):
    material = 'plastic'  # You can change this to generate data for different target materials
    thickness = target_thickness()
    pulse_width = pulse_width()
    energy_val = energy()
    spot_size = spot_size()
    intensity_val = intensity()
    power_val = power()
    cutoff_energy_val = cutoff_energy()
    data.append([material, thickness, pulse_width, energy_val, spot_size, intensity_val, power_val, cutoff_energy_val])

# Print the generated data points
print(data)
```

Keep in mind that this code generates synthetic data consistent with the given statistics and examples. The actual data for each feature might not follow these rules exactly due to the inherent randomness and variability of real-world laser-accelerated ion beam experiments.

